import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import ListSubheader from '@mui/material/ListSubheader';
import IconButton from '@mui/material/IconButton';
import InfoIcon from '@mui/icons-material/Info';
import image1 from '../../assets/img/app_design/Group 1284@3x.png';
import image2 from '../../assets/img/app_design/Group 1285@3x.png';
import image3 from '../../assets/img/app_design/Group 1286@3x.png';
import image4 from '../../assets/img/app_design/Group 1287@3x.png';
import { createTheme, ThemeProvider } from '@mui/material/styles';


const app_design = () => {
  return (
    <ImageList sx={{ width: 500, height: 450 }}>
      <ImageListItem key="Subheader" cols={2}>
        <ListSubheader component="div">December</ListSubheader>
      </ImageListItem>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            subtitle={item.author}
            actionIcon={
              <IconButton
                sx={{ color: 'rgba(255, 255, 255, 0.54)' }}
                aria-label={`info about ${item.title}`}
              >
                <InfoIcon />
              </IconButton>
            }
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: {image1},
    title: 'Copodeals',
    author: '@bkristastucchio',
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: {image2},
    title: 'coloniume',
    author: '@rollelflex_graphy726',
  },
  {
    img: {image3},
    title: 'sixteen89',
    author: '@helloimnik',
  },
  {
    img: {image4},
    title: 'Coffee',
    author: '@nolanissac',
    cols: 2,
  },
 
]

export default app_design;
